Lego Marvel 76262 Marvel Kaptan Amerika’nın Kalkanı
Yetişkin Marvel meraklıları, Marvel Sinematik Evrenindeki en simgeleşmiş öğelerden birini canlandırarak tutkularını sergileyebilir. LEGO® Marvel Kaptan Amerika'nın Kalkanı (76262), yapımı keyif verici olan ve tamamlandıktan sonra uzun süre hayranlık uyandıran ayrıntılı ve orijinal bir modeldir. Kötülüğe karşı iyiliğin simgesi 3128 parçalı modelin çapı 47 cm'dir ve isim levhalı bir stant üzerinde durur. Daha fazla kolaylık için setin yapım talimatlarının dijital versiyonuna LEGO Builder uygulamasından ulaşabilirsiniz.;

Simgeleşmiş kalkan – LEGO® Marvel Kaptan Amerika’nın Kalkanı (76262), kötülüğe karşı iyiliğin ünlü simgesinin orijinal bir yapım ve sergileme modelidir;
Sergilenmeye hazır – Kalkan, isim levhası bulunan bir stant üzerinde durur ve kendi kalkanına ve Thor'un çekici Mjölnir’e sahip Kaptan Amerika minifigürüyle birlikte gelir;
Tatmin edici zorlukta bir yapım projesi – Model severler, yapım parçalarıyla çizgi roman tarihinin bir parçasını canlandırırken bu sürükleyici projede kendilerini kaybedebilirler;
Yetişkinler için hediye – Bu uygulamalı yapım seti, bir Marvel hayranına, LEGO® severe veya model meraklısına uygun bir hediye olacaktır;
Sergilenmeye değer bir model – Tamamlanan modelin çapı 47 cm'dir;
Mobil cihazınızı kullanın – Ekstra rahatlık için setin yapım talimatlarının dijital bir versiyonunu LEGO® Builder uygulamasında bulabilirsiniz;
Sezgisel yapım talimatları – Çocuklar, sürükleyici bir yapım deneyimi için modelleri 3 boyutlu yakınlaştırıp döndürmelerine, setleri kaydetmelerine ve ilerlemeyi takip etmelerine olanak tanıyan dijital araçlar içeren LEGO® Builder uygulamasını indirebilir;
Rahatlayın ve deşarj olun – Yetişkinler için LEGO® Setleri koleksiyonu, yapım süreci tamamlandıktan sonra da uzun süre devam eden tatmin edici bir yapım ve sergileme deneyimi sunar;
Kalite garantili – Tutarlı, uyumlu ve inşa etmesi kolay LEGO® yapım parçaları, sektörün katı kalite standartlarına uygundur;
Güvenlik garantili – LEGO® yapım parçaları, titiz global güvenlik standartlarına uygun olduğundan emin olmak için düşürülür, ısıtılır, ezilir, bükülür ve analiz edilir

Lego Disney 43240 Princess Malefiz’in Ejderha Formu
LEGO® ǀ Disney Princess Malefiz’in Ejderha Formu (43240) inşa edilebilen oyun setini yaparken 7 yaş ve üzeri çocukları ve Disney Uyuyan Güzel hayranlarını destansı hikayeler bekliyor. Eğlenceli bir Disney hediyesi fikri olan bu yapım seti, kuleli bir köprü bölümüne ve bir yatak için yere, dönen bir çıkrığa ve başka oyun başlatıcılara sahiptir. Aurora ve Prince Phillip LEGO ǀ Disney mini bebek figürleri, bir Samson LEGO ǀ Disney at figürü ve başı, bacakları, kuyruğu hareket edebilen ve kanatları katlanan, duruşu ayarlanabilir bir LEGO ǀ Disney ejderha figürü içerir. Bu inşa edebilen oyun seti, 7 yaş ve üzeri çocuklar için yapılmıştır ve yeni hikayeler oluştururken öz güvenlerini geliştirmeye yardımcı olur. Arkadaşların evine oynamaya giderken kolayca götürülebilir ve serideki diğer LEGO çocuk yapım setlerine ve LEGO ǀ Disney yapım oyuncaklarına (ayrı satılır) eklenebilir. Çocuklar ayrıca LEGO Builder uygulamasıyla kolay ve sezgisel bir yapım deneyimi yaşar. Modelleri 3 boyutlu yakınlaştırabilir ve döndürebilir, setleri kaydedebilir ve ilerlemeyi takip edebilirler.;

Çocuklar için inşa edilebilen ejderha oyuncağı – İnşa edilebilen Malefiz’in Ejderha Formu oyun setini 7 yaş ve üzeri kız ve erkek çocuklara hediye edin, çocuklar kendi Uyuyan Güzel hikayelerini canlandırırken yaratıcılıkları gelişsin;
Duruşu ayarlanabilir model – Kanatları katlanan, duruşu ayarlanabilir bir ejderha yapım oyuncağı, bir köprü ve kule kesiti, Aurora ve Prens Phillip LEGO® ǀ Disney mini bebek figürleri ve bir LEGO ǀ Disney at figürü;
Çocuklar için eğlenceli yapım seti – İnşa edilebilen kuleli köprüde Aurora için bir yatak ve döndüğünde sarmaşıkları hareket ettiren bir çıkrık, bir zırh, asa ve başka oyun başlatıcılar bulunur;
Uyuyan Güzel yapım oyuncağı – Bu LEGO® ǀ Disney yapım seti, hayranların Uyuyan Güzel hikayesini istedikleri gibi yeniden hayal etmelerine ya da en iyi film sahnelerini tekrar tekrar canlandırmalarına olanak tanır;
Film hayranları ve çocuklar için hediye – 7 yaş ve üzeri kız ve erkek çocuklarla Disney hayranları için inşa edilebilen kale köprüsü bölümü, duruşu ayarlanabilir ejderha ve 2 ünlü film karakteri içeren, inşa edilebilen oyun seti hediye fikri;
Yardımcı uygulama – Model severlerin yeni beceriler kazanırken modelleri 3 boyutlu olarak yakınlaştırabileceği ve döndürebileceği, ilerlemelerini takip edebileceği ve setleri kaydedebileceği LEGO® Builder uygulamasındaki sezgisel talimatları keşfedin;
Yaşam becerilerini geliştir – 2 LEGO® ǀ Disney mini bebek figürü, duruşu ayarlanabilir bir LEGO ǀ Disney ejderha figürü ve LEGO ǀ Disney at figürü, eğlence yoluyla yaratıcı oyunları ve önemli yaşam becerilerini teşvik eder;
Ölçüler – Çocuklara yönelik bu 583 parçalı yapım seti, 18 cm boyunda duruşu ayarlanabilir LEGO® ǀ Disney ejderha figürü içerir.;

